import React from 'react';
import Navbar from '../../components/Nav/Nav';
import './home.css';

const HomePage = () => {
  return (
    <div className='homepage'>
      <Navbar />
      <div>
        <h1 className='major-mono'> POW Homepage</h1>
      </div>
    </div>
  );
};

export default HomePage;
